import React, { useState } from "react";

import Box from "@material-ui/core/Box";
import AForm from "./aForm";
import ASection from "./aSection";
import ATextField from "./aTextField";
import Button from "@material-ui/core/Button";

const TestContentPanel = (props) => {
  const [mode, setMode] = useState("edit");
  const [variant, setVariant] = useState("classic");
  return (
    <Box width="800px">
      <AForm defaultVariant="classic">
        <ATextField name="id" label="ID" />
        <ATextField
          name="firstName"
          label="Q1. Please take care to anser this question!"
          value="abc"
          autocompleteOptions={[
            { label: "asbvdskcbsdk" },
            { label: "option 2" },
            { label: "option 3" },
            { label: "abcdefg" },
            { label: "cdefg" },
          ]}
        />
        <Button type="submit">Submit</Button>
      </AForm>
    </Box>
  );
};
export default TestContentPanel;
